  <body class="bg-beige h-full" data="ASOMATE-MAT">
    <div class="mx-auto h-full" id="app" v-cloak>
      <av-scene>
        <av-start></av-start>

            <div class="" data-z="false">

            </div>
          </module-switch>
        </av-activity>
      </av-scene>
      <av-scene class="" v-bind:automatic-scene="true" end-audio="" v-bind:force-oks="0">
        <av-end></av-end>
      </av-scene>



      
     
      <av-scene>
        <av-end></av-end>
      </av-scene>
